	"SC.Analytics.Profiler.Profile.Bubble.Appeals": "Appeals provides insights about a judge's record on appeal. In addition, for appellate court judges, learn about the judge's record in disposing of cases from lower courts and/or the judge's record when reviewed by a higher appellate court. The information is derived from appellate cases in which the lower court judge is identified by name.<br><strong>Coverage:</strong><ul class=\"co_listBullet\"><li>U.S. Supreme Court: January 2000 - May 2018</li><li>Federal Circuit Court of Appeals: January 2000 - February 2018</li><li>Federal District Courts: January 2000 - February 2018</li><li>State Courts: January 2000 - August 2018</li></ul>",
	"SC.Analytics.Profiler.Profile.Bubble.History": "Case Type data is derived from federal district court dockets and selected state court dockets. State court data may not be comprehensive due to the following:<ul class=\"co_listBullet\"><li>Some state court dockets are not available online</li><li>Some state court dockets do not include the information needed to derive analytics</li></ul>",
	"SC.Analytics.Profiler.Profile.Bubble.Motions": "Motion data is derived from federal district court dockets and selected state court dockets. State court data may not be comprehensive due to the following:<ul class=\"co_listBullet\"><li>Some state court dockets are not available online</li><li>Some state court dockets do not include the information needed to derive analytics</li></ul>",
	"SC.Analytics.Profiler.Profile.Bubble.Outcomes": "Outcomes includes all civil federal district court cases except for the following case types: Cases involving multi-district litigation (MDL), prisoner rights (KNOS 350), and social security (KNOS 420).",
