	"SC.FormsAssembly.ClientPortal.Constants.Messages.AccountInactive": "<p>The account for the client you are trying to share with is inactive. Please call 1-555-5555 to get the account reactivated. You will need to provide the name of your firm and the name of the client.</p>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.BlockedFormShareMessage": "You do not have access to the following items because they are not authorized under your current subscription agreement",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.FormDownloaded": "<div class=\"zeroState h1\">This form has been downloaded successfully.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.FormMarkCompleted": "<div class=\"zeroState\"><h1>Completed forms cannot be displayed.</h1>To view this item, please download it by selecting print.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpAllDocumentsPage": "<div><div>All present and past documents are listed on this page. You may sort the list by clicking on the heading, then click on any document to work on it or review it.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpCasesPage": "<div><p>All shared and uploaded documents related to your case are listed here and can be sorted by clicking on the heading.</p><p>Also you may securely leave a comment or question for your firm related to this case and view past communications.  Just type your message in the box and click submit.  Your firm will then be notified that you left a message for them.</p></div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpFillOutFormGraphicPage": "<div><p><h3>Filling out the Form</h3><ul><li>Type your answers into each field.</li><li>There may be more than one page, so use the page arrows to make sure every-thing is filled out.</li><li>Click the Mark as Complete button when you are finished.  Your firm will be notified that you are finished.</li></ul><p><p>If you accidently mark the form complete, let your firm know and they can unlock the document for you.</p><p><h3>Saving the Form</h3>You can save the form at anytime by clicking the save button.  When you return, you can start where you left off.</p><p><h3>Leaving a Message</h3>You may securely leave a comment or question about the document and view past communications.  To leave a message, just type your message in the box and click submit and your firm will be notified that you left a message for them.</p><p><h3>Downloading the Form</h3>Click on the download button to save the form to your computer.  You can do this anytime including after you've marked the form as complete.</p></div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpFillOutFormPListPage": "<div><p><h3>Filling out the Form</h3><ul><li>Answer each question.  You can click next or previous to move forward and backwards through the questions.</li><li>When you ansewr the last question, you will see a preview of the document.  You may still need to fill out a few open fields.</li><li>You will not be able to download the form or mark it complete until all the questions are answered.</li><li>Click the Mark Complete button when you are finished.  Your firm will be notified that you are finished.</li></ul></p><p>If you accidently mark the form complete, let your firm know and they can unlock the document for you.</p><p><h3>Saving the Form</h3>You can save the form at anytime by click the save button.  When you return, you can start where you left off.</p><p><h3>Leaving a Message</h3>You may securely leave a comment or question about the document and view past communications.  To leave a message, just type your message in the box and click submit and your firm will be notified that you left a message for them.</p></div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpFillOutFormTextPage": "<div><p><h3>Filling out the Form</h3><ul><li>Answer each question.  You must click next or previous to move between the fields in the form shown below and then type in your answer.</li><li>Click the Mark Complete button when you are finished.  Your firm will be notified that you are finished.</li></ul></p><p>If you accidently mark the form complete, let your firm know and they can unlock the Document for you.</p><p><h3>Saving the Form</h3>You can save the form at anytime by clicking the save buttons.  When you return, you can start where you left off.</p><p><h3>Leaving a Message</h3>You may securely leave a commnet or question about the document and view past communications.  To leave a message, just type your message in the box and click submit and your firm will be notified that you left a message for them.</p><p><h3>Downloading the Form</h3>Click on the download button to save the form to your computer.  You can do this anytime including after you have marked the form complete.</p></div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpReviewDocumentPage": "<div>Once you have finished reading a document, click the mark as read button next to the title so that your firm knows that you've finished.  You can also download the document to your computer and securely leave comments or questions about the document.  To leave a message, just type your message in the box and click submit and your firm will be notified that you left a message for them.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpTasksPage": "<div>This page displays all your current tasks, click on a task to view the document. When you are finished with a document, mark the document as read or as completed and it will be removed from this list.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.HelpUploadDocumentPage": "<div>All your uploaded documents are listed on this page. You may sort the list by clicking on the heading. Remove any item from this list by clicking the remove link. Your firm will still be able to view documents that you have removed.<br/><b>How to Upload a Document:</b><br/>1. Click the browse button to find the document on your computer that you wish to upload.<br/>2. If you have more than one open case with your firm, assign the document to the correct case.<br/>3. Click the upload button to share the document with your firm.</div>",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.InviteShareEmptyEmailMessage": "No email address specified",
	"SC.FormsAssembly.ClientPortal.Constants.Messages.InviteShareErrorMessage": "We were unable to share the form(s) with your client. Please wait a few seconds and try again. If you continue to have problems sharing, contact our Technical Support at 1-800-787-8717 or support.firmportal@thomsonreuters.com for assistance.",
