	"SC.Report.DocAnalyzer.OnBoardingTour.v2.MarketingLink.Link": "legalsolutions.com",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.MarketingLink.Text": "For more training materials, visit",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep1.Content": "Review the cases cited within your opponent's document to see if any are no longer good law. We run a full KeyCite check on all the citations imported from the document and alert you to any potential issues. The warnings are categorized by severity, so you can review the most important ones first.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep2.Content": "Our new KeyCite enhancement identifies the relevant language from within the treating case to let you know why the KeyCite flag exists. If the case also contains an Overruling Risk warning, the colored highlighting will let you know which case is applying which treatment.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep3.Content": "The Table of authorities tab contains the full list of all the cases cited in your opponent's document, regardless of whether we found a KeyCite issue or not. Use this to quickly review and deliver all the cited cases in a document.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep4.Content": "We use AI (Artificial Intelligence) to analyze your opponent's document for arguments and facts to uncover relevant law. <b>Omitted authority</b> shows you additional cases and other materials that may be relevant to the document. Use this tab to see if there is relevant authority that can undermine your opponent's position.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep5.Content.Part1": "We analyze your opponent's document and provide focused recommendations for each section. We use the headings within the document to determine which issues are relevant.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep5.Content.Part2": "A. Filter out sections you don’t want to see using the <b>Document Headings</b> filter.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep5.Content.Part3": "B. You can also jump to a specific section using the <b>Navigate Headings</b> button.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep5.Content.Part4": "C. Collapse and expand headings to view the recommendations you are most interested in.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep6.Content.Part1": "You can see headnotes and relevant language from the case. We analyze the language of your opponent's document to pinpoint the most relevant parts of a recommended case, helping you quickly see how a recommendation might be useful.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep6.Content.Part2": "You can also see the <b>outcome</b> of relevant issues within the recommended case. These outcomes are tailored to specific issues based on the document.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep7.Content.Part1": "Our AI looks at the cases your opponent cited and alerts you when one of our recommendations is related to some of these already-cited cases.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep7.Content.Part2": "Some recommendations may be cases you've already seen in the course of your research. You can filter out recommendations that you have recently viewed, foldered, or annotated.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentStep8.Content": "Some recommendations will have special properties that might make them more applicable to your research. You can see these aspects highlighted in the margin. You can also filter based on these aspects to see only the types of recommendations that you are interested in.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.OpponentTakeTour": "Quick Check is a next-generation document analysis tool. Quick Check leverages your opponent’s document to create a quickly-reviewable report that allows you to review the opponent’s cited cases to look for potential weaknesses and recommends relevant authority that the opponent chose not to cite, which may undermine their position. <br><br>Would you like a brief tour?",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step1.Content": "We use AI (Artificial Intelligence) to analyze your document for arguments and facts to uncover relevant case law. <b>Recommendations</b> shows you additional cases and other materials that may be relevant to your document.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step2.Content.Part1": "We analyze your uploaded document and provide focused recommendations for each section. We use the headings within your document to determine which issues are relevant to you.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step2.Content.Part2": "A. Filter out sections you don’t want to see using the <b>Document headings</b> filter",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step2.Content.Part3": "B. Jump to a specific section using the <b>Navigate headings</b> button",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step2.Content.Part4": "C. Collapse and expand headings to view the recommendations you are most interested in",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step3.Content.Part1": "You can see headnotes and relevant language from the case. We analyze the language of your document to pinpoint the most relevant parts of a recommended case, helping you quickly see how a recommendation might be useful.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step3.Content.Part2": "You can also see the <b>outcome</b> of relevant issues within the recommended case. These outcomes are tailored to specific issues based on your document.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step4.Content.Part1": "Our AI looks at the cases that you've already cited and alerts you when one of our recommendations is related to some of these already-cited cases. ",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step4.Content.Part2": "Some recommendations may be cases you've already seen in the course of researching your document. You can filter out recommendations that you have recently viewed, foldered, or annotated.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step5.Content": "Recommendations may have special properties that might make it more applicable to your research. You can see these aspects highlighted in the margin. You can also filter based on these aspects to see only the types of recommendations that you are interested in.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step6.Content": "Verify that the cases cited within your document are still good law. We run a full KeyCite check on all the case citations imported from your document and alert you to any potential issue. The warnings are categorized by severity so you can review the most important first.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step7.Content": "Our new KeyCite enhancement identifies the relevant language from within the treating case to let you know why the KeyCite flag exists. If the case also contains an Overruling Risk warning, the colored highlighting will let you know which case is applying which treatment.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.Step8.Content": "The Table of authorities tab contains the full list of all the cases cited in your document, regardless of whether we found a KeyCite issue or not. Use this to quickly review and deliver all the cited cases in a document.",
	"SC.Report.DocAnalyzer.OnBoardingTour.v2.TakeTour": "Quick Check is a next-generation document analysis tool. Quick Check leverages the uploaded document to create a quickly-reviewable report that contains relevant authority that traditional research may have missed and allows you to review the cited cases to see if they are still good law. <br><br>Would you like a brief tour?",
