	"SC.Report.DynamicSurveys.Tour.Step1.Content": "Start your research by entering an on-point citation to find the associated index term.  Select relevant terms to build your survey.",
	"SC.Report.DynamicSurveys.Tour.Step2.Content": "You can also start your research by entering a term related to your legal topic. Once you've found your term, add 1 or 2 more to create a query that will run across all of our indices.<br/><br/>Search tip: Our editors have already categorized each statute and federal regulation by legal issue or topic, so simple searches will yield comprehensive results.",
