	"SC.Search.Bellows.Search.SearchPanel.SearchHleadOnly.summaryText": "Search Headlines and Lead paragraphs",
	"SC.Search.Bellows.Search.SearchPanel.SmartTerms.queryString": "{queryString} and {count} more",
	"SC.Search.Bellows.Search.SmartTermsDescription": "Add Smart Terms to your search or search Smart Terms alone",
	"SC.Search.Bellows.Search.SmartTermsEdit": "edit",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.CloseButtonText": "Close",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.CloseSymbol": "Close",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para1.Sentence1": "Use <strong>SmartTerms</strong> to narrow your news searches, organized by industry, subject, location, and company. SmartTerms are assigned to a document based on the subject represented, so they do not need to appear in a document to retrieve the document. For example, a news article that discusses the commercial release of a newly developed medical device is assigned the SmartTerm <em>Medical Devices</em> even though it doesn't mention the terms <em>medical</em> or <em>device</em>.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Item1": "In Step 3 of the WestClip Alert creation, type a Terms and Connectors search in the Query text box.<strong>Note: </strong>If you want to set up a WestClip entry that searches for SmartTerms only, do not enter a Terms and Connectors search.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Item2": "Click the <strong>SmartTerms</strong> link.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Item3": "Select the <strong>Industry</strong>, <strong>Company</strong>, <strong>Subject</strong>, or <strong>Location</strong> tab. If you select the Company tab, search for a company by typing its common name (e.g., <strong>general mills</strong>), ticker symbol (e.g., <strong>gis</strong>), or SIC code in the text box. From the drop down menus, select <strong>Name</strong>, <strong>Ticker</strong>, or <strong>SIC</strong>, and <strong>Begins With</strong>, <strong>Contains</strong>, or <strong>Exact Phrase</strong>. Click <strong>Search</strong>.  Click <strong>add</strong> next to each company you wish to include in your search.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Item4": "Browse or search the outline that is displayed, clicking <strong>add</strong> to add desired SmartTerms.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Item5": "Repeat steps 3-4 to add SmartTerms from other tabs. When you are finished selecting SmartTerms, click <strong>Save</strong>.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Sentence1": "To add one or more SmartTerms to your WestClip entry, complete these steps",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para2.Title": "Adding SmartTerms to Your WestClip Entry",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para3.Item1": "SmartTerms are added to the Terms and Connectors search with the & (AND) connector. You cannot change this connector.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para3.Item2": "You can search exclusively with SmartTerms; a Terms and Connectors query is not required.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para3.Item3": "By default, SmartTerms you select within a category, e.g., industry, are separated with the OR connector, meaning one or both terms must be in the document for it to be retrieved. To change the connector between two terms, select Or from the drop down box; select <strong>And</strong> if both terms must be in the document for it to be retrieved, or select <strong>Not</strong> to exclude documents that contain the term following Not.If you select SmartTerms from more than one category, e.g., industry and company, the categories are separated with the & (AND) connector. You cannot change this connector.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para3.Item4": "Industry, subject, and location SmartTerms will not be highlighted in your search results.",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para3.Title": "Notes",
	"SC.Search.Bellows.Search.SmartTermsHelpBox.Para4.Sentence1": "To search for Industry, Subject or Location SmartTerms, select the desired tab. Search using the text box located below the tab, using the drop down menu to select <strong>Begins With</strong>, <strong>Contains</strong>, or <strong>Exact Phrase</strong>.  For example, to search for terms in the automotive industry, click the <strong>Industry</strong> tab and type <strong>car</strong> in the text box. Then select <strong>Exact Phrase</strong> from the drop-down list and click <strong>Search</strong>.",
