	"SC.Search.KeyNumberResults.ToolTipMessage": "Key Number results provide links to the most relevant points of law represented by your search terms.  Boolean queries that return Key Number results have been translated to plain language search terms.  West attorney editors have read, summarized and classified case law by topic and subtopics that represent specific points of law.  Each specific point of law is assigned a unique number, called a Key Number.  When you click a Key Number link, you will retrieve the case headnotes classified to that particular Key Number.",
