	"SC.Search.PermissibleUse.CUSOLightbox.CheckboxLabelText": "By checking this box and clicking Submit you acknowledge that you have read and understood the above requirements and will use this product in accordance with these terms.",
	"SC.Search.PermissibleUse.CUSOLightbox.CheckboxLabelTitle": "Skip Tracing for Consumer Collections Acknowledgment",
