	"SC.Search.PermissibleUse.Error.FailedToEnterWorkflow": "Failed to enter the Permissible Use applicable search workflow.",
	"SC.Search.PermissibleUse.Error.FailedToGatherOptions": "Permissible Use Widget Error: Failed to gather permissible use options.",
	"SC.Search.PermissibleUse.Error.FailedToRunStandAloneSearch": "Permissible Use Search failed to complete.",
	"SC.Search.PermissibleUse.Error.InvalidPuCode": "Permissible Use Widget Error: Invalid permissible use code was supplied.",
	"SC.Search.PermissibleUse.Help.FullText": "The information on this site may be regulated by laws that restrict the use of that information, including but not limited to the Drivers&rsquo; Privacy Protection Act, 18 U.S.C. &sect 2721 et seq., or similar state laws (collectively &ldquo;DPPA&rdquo;), the Gramm-Leach-Bliley Act, 15 U.S.C. 6801 et seq. (&ldquo;GLBA&rdquo;), various Federal and State laws, regulations, and rules as well as your Subscriber Agreement. By using this service, you represent and warrant that information regulated by these authorities including DPPA and GLBA will only be used for the purpose selected in the appropriate drop down box. If you do not have a permissible use, you must select &ldquo;no permissible use,&rdquo; and you will not be given access to that information.",
	"SC.Search.PermissibleUse.Info.DPPA": "Use of this data is limited by the Driver&rsquo;s Privacy Protection Act (DPPA) and state law.",
	"SC.Search.PermissibleUse.Info.Fcra": "Thomson Reuters Legal is not a consumer reporting agency and none of its services or the data contained therein constitute a &ldquo;consumer report&rdquo; as such term is defined in the Federal Fair Credit Reporting Act (FCRA), 15 U.S.C. sec. 1681 et seq. The data provided to you may not be used as a factor in consumer debt collection decisioning, establishing a consumer&rsquo;s eligibility for credit, insurance, employment, government benefits, or housing, or for any other purpose authorized under the FCRA. By accessing one of our services, you agree not to use the service or data for any purpose authorized under the FCRA or in relation to taking an adverse action relating to a consumer application.",
	"SC.Search.PermissibleUse.Info.GLB": "Use of this data is limited by the Gramm-Leach-Bliley Act (GLB) and can only be used for specific non-FCRA (Fair Credit Reporting Act purposes).",
	"SC.Search.PermissibleUse.Info.Header": "<p>Some content requires permissible use to access the data.</p><p>Please confirm or update your permissible use or select No Permissible Use if none exists.</p>",
	"SC.Search.PermissibleUse.Info.STCD": "Are you using this product for skip tracing related to consumer debt collection?",
	"SC.Search.PermissibleUse.Info.VOTERS": "Use of the data is limited by state law privacy restrictions.",
	"SC.Search.PermissibleUse.UpdateLink.Text": "Update Permissible Uses",
	"SC.Search.PoweredByWestSearchBox.closeButtonText": "Close",
	"SC.Search.PoweredByWestSearchBox.CloseScreenReader": "Close",
	"SC.Search.PoweredByWestSearchBox.Content.item1": "This is the foundation of WestSearch&trade;. Because thousands of West attorney editors have read, summarized and classified the law by topic for over 100 years, WestSearch&trade; can identify the topics of law best represented by the terms of your search and return highly relevant documents for those topics, even if the documents don't have the terms you put into the search box.",
	"SC.Search.PoweredByWestSearchBox.Content.item1.Title": "West Key Number System&reg;",
	"SC.Search.PoweredByWestSearchBox.Content.item2": "KeyCite maps the citation network among all federal and state cases in the West National Reporter System&trade; (as well as over 1 million unpublished cases), federal and state statutes, and thousands of secondary source publications. WestSearch&trade; analyzes the rich connections among documents, making your results more inclusive and bringing the most relevant documents to the top of the list.",
	"SC.Search.PoweredByWestSearchBox.Content.item2.Title": "KeyCite&reg;",
	"SC.Search.PoweredByWestSearchBox.Content.item3": "With thousands of practice guides, legal encyclopedias, and authoritative treatises, WestSearch&trade; can find primary law that is heavily discussed in each jurisdiction and detect similar phrases that apply to your concepts",
	"SC.Search.PoweredByWestSearchBox.Content.item3.Title": "West Secondary Sources",
	"SC.Search.PoweredByWestSearchBox.Content.itemsHeading": "Key components of WestSearch&trade;:",
	"SC.Search.PoweredByWestSearchBox.Content.para1": "WestSearch&trade; is the world's most advanced legal search engine. It leverages over 100 years of West's editorial analysis of the law, and it emulates the best practices of experienced legal researchers.",
	"SC.Search.PoweredByWestSearchBox.Content.para2": "Whether you run a precise Boolean Terms & Connectors search or just enter simple descriptive terms, WestSearch&trade; employs West's editorial assets much like an expert researcher would &ndash; only faster &ndash; to find the best documents for your research.",
	"SC.Search.PoweredByWestSearchBox.title": "WestSearch&trade;",
