	"SC.Website.Indigo.HomePage.OnboardingTour.FinishText": "Finish",
	"SC.Website.Indigo.HomePage.OnboardingTour.NextBtn": "Next",
	"SC.Website.Indigo.HomePage.OnboardingTour.PrevBtn": "Back",
	"SC.Website.Indigo.HomePage.OnboardingTour.SelectContentType": "Select <b>Content types</b> to continue",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step1": "Start typing a question in the search bar, and type ahead will provide a range of questions based on the legal terms you enter. Click on the type ahead question that best matches what you were asking and it will take you to the law summary with supporting case law.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step2": "The <b>Search Suggestions</b> feature provides type ahead suggestions as you enter terms into the search bar.  Find cases specific to your legal issue by clicking on the suggestion which best matches what you are researching and it will take you to relevant case law results.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step3": "<b>Litigation Analytics</b> provides data analysis and visualizations for federal district court judges. As you type the name of a judge into the search bar, <b>Litigation Analytics</b> will suggest questions regarding that judge's history of ruling on common motions.<br></br> In addition, typing the name of a legal professional, company, or popular statute will provide an overview of that entity in the type ahead with a link to its Snapshots profile.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step4": "The type ahead drop-down options are organized by content type to make searching quicker and more intuitive. As you enter search terms, the type ahead options will automatically shift to the most relevant suggestion and content type.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step5": "Westlaw Edge will provide a notification when a colleague shares content such as folders, notes, highlights, or snippets with you. You will also see notifications within Westlaw Edge when alerts you created find documents. <b>Notifications</b> will also be shown when Westlaw Edge has document recommendations for you based on your research.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step6": "You can manage which notifications you receive in the Preferences section of your Profile in the Westlaw Edge header.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step7": "With <b>Litigation Analytics</b>, you can find insights about judges, courts, and case types to build a winning case strategy.<br></br><b>Quick Check</b> allows you to securely upload your brief or motion to quickly find new authority and related law.",
	"SC.Website.Indigo.HomePage.OnboardingTour.Step7.NoDocAnalyzer": "With <b>Litigation Analytics</b>, you can find insights about judges, courts, and case types to build a winning case strategy.<br></br>",
	"SC.Website.Indigo.HomePage.OnboardingTour.TakeTour": "Would you like a brief tour of some of the new Westlaw Edge features that can help you complete your research faster and more effectively?",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Button.Close": "Close",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Button.Next": "Next",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Button.Previous": "Back",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.CancelButtonText": "Maybe later",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.ConfirmButton": "Take the tour",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.DoNotShowButtonText": "Don't show me this",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.FinishText": "Finish",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step1.Content": "Start your research by typing the name of a legal professional, court, or case type in the search box.  As you type, we will display relevant results directly in the type ahead.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step1.Special": "Type and select the name of a federal district court judge",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.Content": "<p>Litigation Analytics delivers relevant, data-driven insights from state and federal dockets and cases to help you manage client expectations and build a winning case strategy--from initial case assessment, all the way to appeal.</p></br><p>Each Litigation Analytics entity has an overview, which provides a snapshot of data about that entity.</p></br><p>The tabs across the top of the page list the reports we have available for that particular entity. Report availability varies by entity type.</p>",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.SearchResults.Content": "Running a search in Litigation Analytics will return relevant results where Westlaw Edge has analytics.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.SpecialBox": "Select <b>{tabName}</b> to continue",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step3.Content": "Each Litigation Analytics report has search within capability, which helps you find documents that contain the keywords you need. The advanced search within capability allows you to search the text of dockets as well as their related filings.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step4.Content": "Each Litigation Analytics report has full filtering capability that allows you to narrow down the result list to exactly what you are looking for, which helps you find matters that are most like yours.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step5.Content": "Each Litigation Analytics report has a data visualization component with different views of the data that make up the result list. For example, you can easily see the likelihood of a motion type being granted, and with one click, you can toggle over and see how long it will take for that motion type to get a final ruling.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step6.Content": "Each Litigation Analytics report has a result list of all dockets we have for a particular entity. In addition to having a link to the docket, we also provide links to the motion and orders, as well as, any other related filings for the case.",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.TakeTour": "Litigation Analytics is an exciting new feature included in Westlaw Edge that delivers relevant, data-driven insights from state and federal dockets and cases to help you manage client expectations and build a winning case strategy. Would you like a brief tour?",
	"SC.Website.Indigo.LegalAnalytics.OnboardingTour.TakeTour.AlternateCloseText": "Close",
	"SC.Website.Indigo.OnboardingTour.MarketingLink.Link": "legalsolutions.com",
	"SC.Website.Indigo.OnboardingTour.MarketingLink.Text": "For more training materials, visit",
	"SC.Website.Indigo.PageSurvey.LightBoxBody": "<div><p>Your feedback has been successfully submitted!</p><span><i>Your opinions and comments are very important to us. We continue to work to improve Westlaw Edge and appreciate you taking the time to share your thoughts.</i></span></div>",
