	"SC.Website.PoweredByKeyCiteBox.ForMoreInfo": "For more information on using KeyCite,  please see the KeyCite tutorial in the Training & Support Center.",
	"SC.Website.PoweredByKeyCiteBox.KeyCiteBlueFlag": "KeyCite Blue Flag",
	"SC.Website.PoweredByKeyCiteBox.KeyCiteOverrulingFlag": "Implied Overruling Risk Warning",
	"SC.Website.PoweredByKeyCiteBox.KeyCiteOverrulingFlag.Description": "The Overruling Risk warning indicates that a document may no longer be good for at least one point of law based on its reliance on an overruled or otherwise invalid prior decision.",
	"SC.Website.PoweredByKeyCiteBox.KeyCiteRedFlag": "KeyCite Red Flag",
	"SC.Website.PoweredByKeyCiteBox.KeyCiteYellowFlag": "KeyCite Yellow Flag",
	"SC.Website.PoweredByKeyCiteBox.Paragraph1": "KeyCite is the powerful citation research service available exclusively on Westlaw. Use KeyCite at every step of your research to help you find, understand, and update the law.",
	"SC.Website.PoweredByKeyCiteBox.Paragraph2": "The KeyCite citation network is integrated with the West Key Number system. This integration allows KeyCite to connect documents that discuss the same legal issues with the analytical materials that explain those issues.",
	"SC.Website.PoweredByKeyCiteBox.Paragraph3": "Once you have found a document upon which to base your legal argument, KeyCite Flags alert you to negative references or events that may impact the validity of that document.",
	"SC.Website.PoweredByKeyCiteBox.Paragraph4.YellowFlag.CasesAndAdministrativeDecisions": "• Cases & Administrative Decisions - some negative treatment, but not reversed or overruled",
	"SC.Website.PoweredByKeyCiteBox.Paragraph4.YellowFlag.PatentsAndTrademarks": "• Patents & Trademarks - not infringed, but did not rule on its validity, all or part valid and not infringed, held a trademark was not diluted, or held a trademark was not violated by unfair competition",
	"SC.Website.PoweredByKeyCiteBox.Paragraph4.YellowFlag.StatutesAndRegulations": "• Statutes & Regulations - proposed legislation or rule available, court decision has questioned validity, or prior version received negative treatment from a court",
	"SC.Website.PoweredByKeyCiteBox.Paragraph5.RedFlag.CasesAndAdministrativeDecisions": "• Cases & Administrative Decisions - no longer good for at least one point of law",
	"SC.Website.PoweredByKeyCiteBox.Paragraph5.RedFlag.PatentsAndTrademarks": "• Patents & Trademarks - all or part is invalid, invalid and not infringed, all or part of a patent is unenforceable due to the patentee's inequitable conduct, or a trademark is cancelled",
	"SC.Website.PoweredByKeyCiteBox.Paragraph5.RedFlag.StatutesAndRegulations": "• Statutes & Regulations - amended, repealed, superseded, or held unconstitutional or preempted in whole or in part",
	"SC.Website.PoweredByKeyCiteBox.Paragraph6": "A blue-striped flag indicates a document has been appealed to the U.S. Courts of Appeals or the U.S. Supreme Court (excluding appeals originating from agencies).",
	"SC.Website.PoweredByKeyCiteBox.Paragraph7": "KeyCite citing references help you investigate how other authorities have interpreted that document.  If your document is a court decision, KeyCite History tells you if that decision was reversed or upheld in a later appeal.",
