	"SC.Website.Widget.TocPageSectionWidget.TOCUsageHelpLightboxText": "<h3>Quick start instructions:</h3> <p> Use <strong>Tab</strong> key to move into Table of Contents (\"TOC\"), then use <strong>Tab</strong> again to leave TOC. To navigate within the TOC, use your <strong>Arrow</strong> keys. Use <strong>Space</strong> to select checkboxes and <strong>Enter</strong> to follow links. </p> <h3>Detailed keystroke navigation instructions:</h3> Once inside the TOC, the following keys provide navigation as described below. <ul class='co_listBullet'> <li><strong>Right Arrow</strong>: <ul class='co_listCircle'> <li>Opens a collapsed heading or subheading one level (does not move focus automatically).</li> <li><strong>Arrow</strong> again to move into a deeper level of the TOC.</li> </ul> </li> <li> <strong>Left arrow</strong>: <ul class='co_listCircle'> <li>When focus is on an expanded heading or subheading, it closes the heading or subheading.</li> <li>When focus is on a subheading that is also either fully expanded or on a collapsed subheading, it moves focus to up one level in the hierarchy.</li> </ul> </li> <li><strong>Down Arrow</strong>: Moves focus to the next subheading that is focusable without opening or closing a subheading.</li> <li><strong>Up Arrow</strong>: Moves focus to the previous heading or subheading that is focusable without opening or closing it.</li> <li><strong>Home</strong>: Moves focus to the first heading or subheading in the TOC without opening or closing it.</li> <li><strong>End</strong>: Moves focus to the last heading or subheading in the TOC that is focusable without opening it.</li> <li><strong>Enter</strong>: If the item having focus is a link, pressing <strong>Enter</strong> follows the link; if the text is not link, pressing <strong>Enter</strong> does nothing.</li> <li><strong>Space</strong>: Toggles the selection state of the focused heading or subheading (i.e., checks or unchecks it).</li> </ul>",
